import { elementData } from "./JSONRetriever";


function computePhaseState(element, temperature) {
    if (elementData[element].boilingPoint !== "unknown") {
        if (elementData[element].boilingPoint < temperature) {
            return "gas";
        }
    }

    if (elementData[element].meltingPoint !== "unknown") {
        if (elementData[element].meltingPoint > temperature) {
            return "solid";
        }
        else if (elementData[element].boilingPoint !== "unknown") {
            return "liquid";
        }
    }

    return "unknown";
}


export { computePhaseState }
